SET CHARSET UTF8;
SET sql_mode='NO_BACKSLASH_ESCAPES';
CREATE TABLE `lines`(
   line_cd      INTEGER  NOT NULL PRIMARY KEY
  ,company_cd   INTEGER  NOT NULL
  ,line_name    VARCHAR(19) NOT NULL
  ,line_name_k  VARCHAR(24) NOT NULL
  ,line_name_h  VARCHAR(19) NOT NULL
  ,line_color_c VARCHAR(6)
  ,line_color_t VARCHAR(8)
  ,line_type    VARCHAR(30)
  ,lon          NUMERIC(18,14) NOT NULL
  ,lat          NUMERIC(18,15) NOT NULL
  ,zoom         INTEGER  NOT NULL
  ,e_status     INTEGER  NOT NULL
  ,e_sort       INTEGER  NOT NULL
);
CREATE TABLE stations(
   station_cd     INTEGER  NOT NULL PRIMARY KEY
  ,station_g_cd   INTEGER  NOT NULL
  ,station_name   VARCHAR(17) NOT NULL
  ,station_name_k VARCHAR(30)
  ,station_name_r VARCHAR(30)
  ,line_cd        INTEGER  NOT NULL
  ,pref_cd        INTEGER  NOT NULL
  ,post           VARCHAR(8) NOT NULL
  ,addr           VARCHAR(26) NOT NULL
  ,lon            NUMERIC(18,14) NOT NULL
  ,lat            NUMERIC(18,15) NOT NULL
  ,open_ymd       VARCHAR(10)
  ,close_ymd      DATE
  ,e_status       INTEGER  NOT NULL
  ,e_sort         INTEGER  NOT NULL
);
